import * as React from 'react';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import Divider from '@mui/material/Divider';

export default function ContainedButtons() {
    const [recordState, setState] = React.useState({
        start: false,
        break: true,
        stamp: true,
        stop:  true,
        save:  true
    });
    return (
        <Box>
            <Stack direction="row" spacing={2}>
                <Button 
                    variant="contained"
                    onClick={()=>{
                        setState({
                            ...recordState,
                            start: true,
                            break: false,
                            stamp: false,
                            stop:  false,
                            save:  true
                        });
                    }}
                    disabled={recordState.start}
                >
                    スタート
                </Button>
                <Button
                    variant="contained"
                    onClick={()=>{
                        setState({
                            ...recordState,
                            start: false,
                            break: true,
                            stamp: true,
                            stop:  true,
                            save:  true
                        });
                    }}
                    disabled={recordState.break}
                >
                    一時中断
                </Button>
                <Button
                    variant="contained"
                    onClick={()=>{
                        setState({
                            ...recordState,
                            start: true,
                            break: false,
                            stamp: false,
                            stop:  false,
                            save:  true
                        });
                    }}
                    disabled={recordState.stamp}
                >
                    タイムスタンプ
                </Button>
                <Button 
                    variant="contained"
                    onClick={()=>{
                        setState({
                            ...recordState,
                            start: true,
                            break: true,
                            stamp: true,
                            stop:  true,
                            save:  false
                        });
                    }}
                    disabled={recordState.stop}
                >
                    停止
                </Button>
                <Button
                    variant="contained"
                    onClick={()=>{
                        setState({
                            ...recordState,
                            start: false,
                            break: true,
                            stamp: true,
                            stop:  true,
                            save:  true
                        });
                    }}
                    disabled={recordState.save}
                >
                    保存
                </Button>
                <Button 
                    variant="contained"
                    onClick={()=>{
                        setState({
                            ...recordState,
                            start: false,
                            break: true,
                            stamp: true,
                            stop:  true,
                            save:  true
                        });
                    }}
                >
                    リセット※記録は破棄されます
                </Button>
            </Stack>
            <Box sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}>
                <nav aria-label="main mailbox folders">
                    <List>
                        <ListItem disablePadding>
                            <ListItemButton>
                                <ListItemText primary="Inbox" />
                            </ListItemButton>
                        </ListItem>
                        <ListItem disablePadding>
                            <ListItemButton>
                                <ListItemText primary="Drafts" />
                            </ListItemButton>
                        </ListItem>
                    </List>
                </nav>
                <Divider />
                <nav aria-label="secondary mailbox folders">
                    <List>
                        <ListItem disablePadding>
                            <ListItemButton>
                                <ListItemText primary="Trash" />
                            </ListItemButton>
                        </ListItem>
                        <ListItem disablePadding>
                            <ListItemButton component="a" href="#simple-list">
                            <   ListItemText primary="Spam" />
                            </ListItemButton>
                        </ListItem>
                    </List>
                </nav>
            </Box>
        </Box>
    );
}
